import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="container">
      <h1>Welcome to the Password Reset Application</h1>
      <p>If you forgot your password, you can reset it here.</p>
      <Link to="/forget-password" className="btn btn-primary">
        Reset Password
      </Link>
    </div>
  );
};

export default Home;
